import './TodoItem.css';

function TodoItem(props) {
    return (
        <li>
            <label className="custom-radio-checkbox">
                <input className="custom-radio-checkbox__input" type="radio" />

                <span className={`custom-radio-checkbox__show custom-radio-checkbox__show--radio ${props.completed && "custom-radio-checkbox__show--radio"}`}></span>

                <p>{props.text}</p>
            </label>
        </li>
    );
}
export { TodoItem };
